import React from "react";
 function Navi(){
    return(
    <>
    <div style={navi}>
        {/* <h3>this is my navigation component</h3>, */}

        <ul>
            <li>Homes</li>
            <li>About</li>
            <li>Contact</li>
            <li>Services</li>
            <li>Achivements</li>

        </ul>
    </div>      
</>
    );
 }

 let navi={
    border:"5px solid green",
    color:"red",
    hight:"100px",
    width:"100%",
    display:"flex",
    // justifyContent:"center",
    alignContent:"end",

 }

 




export default Navi;
